import * as React from "react";
import logo from "../Images/CSVValED.png";
import about from "../Images/exclamationPoint.svg";
import help from "../Images/exclamationPoint.svg";
import './Heading.css';

class Heading extends React.Component {
    render() {
        return (
            <h1 class="text-left" >
                <span className="badge bg-warning" id="help" dataBsToggle="modal" data-bs-target="#modalHelp" role="button">
                   <img src={about} />
                </span>

                <a href="/">
                    <img src={logo} alt="CSVValEd" />
                </a>

                <span className="badge bg-primary" id="about" data-bs-toggle="modal" data-bs-target="#modalAbout" role="button">
                    <img src={help} />
                </span>
            </h1>
        );
    }
}

export default Heading;
